import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel } from 'react-bootstrap';
import Scarf1 from './Assets/scarf1.JPG';
import Scarf2 from './Assets/scarf2.JPG';
import Scarf3 from './Assets/scarf3.JPG';
import { Link, Route, Router } from "react-router-dom";
import { Button, Form, FormControl } from "react-bootstrap";
import Navigation from './Navigation'

function Home() {
  return (
    <div className='home'>
<Navigation/>
    <h1>NatureKnitter</h1>

      <div className = "caro">


      <Carousel>
  <Carousel.Item>
    <img className="scarfa"
      src={Scarf1}
      width={800}
      height={545}
      alt="First slide"
      />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img className="scarfb"
      src={Scarf2}
      width={800}
      height={545}
      alt="Second slide"
      />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item><Carousel.Item>
    <img className="scarfc"
      src={Scarf3}
      width={800}
      height={545}
      alt="Third slide"
      />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
    </div>
      </div>
  );
}

export default Home;
